  false,\n\t\"url\": null,\n\t\"notes\": \"For the fourth consecutive year, USFWS
  conducted a walrus harvest, health and welfare study in five northern Bering Sea
  coastal villages during the spring of 1983. Goals were to determine harvest levels,
  age structure, and contaminant levels for various body organs and tissue of harvested
  walruses (Odobenus rosmarus divergens). The documented harvest level for the Nome
  and. King Island areas were 407 and 230 walruses respectively. One hundred forty-four
  pair of teeth and tissue specimens from 16 walruses were acquired and await analysis.
  Sex composition of the harvest was appreciably different than previous years for
  Nome while the King Island sex composition of harvested walruses varied to a lesser
  degree from previous years. A documented minimum harvest of 119 bearded, 44 ringed
  and 10 spotted seals were recorded at Nome.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
